import React from "react";

class User extends React.Component {
  render() {
    return (
      <div>
        {this.state.users.map((el) => (
          <div className="user" key={el.id}>
            <h3>
              {el.firstname} {el.lastname}
            </h3>
            <p>{el.bio}</p>
            <b>{el.isHappy ? "Happy :)" : "Not enough :("}</b>
          </div>
        ))}
      </div>
    );
  }
}

export default User;
